// Пример компонента ProductCard.js
import React from 'react';
import './ProductCard.css'; // Если у вас отдельный CSS для компонента

const ProductCard = ({ product }) => (
  <div className="product-card"> {/* Убедитесь, что этот класс определен в вашем CSS */}
    <img src={product.image} alt={product.name} />
    <h3>{product.name}</h3>
    <p>{product.description}</p>
    <p className="price">${product.price}</p>
    <button className="btn-product">Add to Cart</button>
  </div>
);

export default ProductCard;
